class Solution:
    def longestPalindrome(self, words) -> int:
        # optimal solution 
        m = defaultdict(int)
        unpaired = ans = 0
        for w in words:
            if w[0] == w[1]:
                if m[w] > 0:
                    unpaired -= 1
                    m[w] -= 1
                    ans += 4
                else: 
                    m[w] += 1
                    unpaired += 1
            else:
                if m[w[::-1]] > 0:  # w[::-1] -> reversed w
                    ans += 4
                    m[w[::-1]] -= 1
                else: m[w] += 1
        if unpaired > 0: ans += 2
        return ans

